import React from "react";
import { Route, Redirect } from "react-router-dom";

const PrivateRoute = ({isAuth, component: Component, ...rest}) =>{
    return (
        <Route {...rest} render = {(props)=>isAuth?(
                <div>
                    <Header/>
                    <div style={{marginTop:"50px",overflowX:"scroll"}}>
                        <Component {...props}/>
                    </div>
                </div>
            ):(
                <Redirect to = {"/"}/>)
            }/>
    );
}
